import React from "react";
import styled from "styled-components";



const CompletedDiv = styled.div`{
cursor: pointer;
color: ${props => props.status[0] ? "black" : props.status[1] ? "white" : "black"};
}`


const Track = ({ track, handleToggle }) => {

  const handleClick = (e) => {
    e.preventDefault()
    handleToggle(e.currentTarget.id)
  }
  return (
    <>
      <CompletedDiv
        id={track.id}
        name="track"
        value={track.id}
        onClick={handleClick}
        status={Object.entries(track.status).map(([key, value]) => (
          track.status[key]))}
      >
        {track.title}
      </CompletedDiv >

    </>
  );



};

export default Track;
